
CREATE SEQUENCE seq_house_price_id
    START WITH 100
    INCREMENT BY 1 ;



CREATE TABLE house_price (
  house_price_id INT NOT NULL DEFAULT (NEXT VALUE FOR seq_house_price_id),
  suburb_id INT,
  suburb VARCHAR(50),
  house_low_quartile FLOAT,
  house_median_quartile FLOAT,
  house_high_quartile FLOAT,
  unit_low_quartile FLOAT,
  unit_median_quartile FLOAT,
  unit_high_quartile FLOAT,
  house_median_quartile_string VARCHAR(50),
  unit_median_quartile_string VARCHAR(50),
  CONSTRAINT PK_house_price_id PRIMARY KEY CLUSTERED (house_price_id)

);


